import React, { useState } from "react";
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
// import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import TurnedInNotIcon from '@mui/icons-material/TurnedInNot';
import BookmarkIcon from '@mui/icons-material/Bookmark';
import "../images/.."
import { set } from "mongoose";
// import IconButton from "@mui/icons-material/IconButton";


function Home(props) {

    const [clicked, setClicked] = useState(false)
    function handleIconClick() {
        if (setClicked === false) {
            setClicked = true
        } else {
            setClicked = false
        }


        // setClicked = setClicked ? true : false
        // console.log(setClicked)
        return setClicked
    }


    return (
        <div>
            {/* <div className="term">
                 <span className="emoji" role="img" aria-label="Tense Biceps">
                     {props.image}
                 </span>
                 <dt>
                     <span>{props.name}</span>
                 </dt>
                <dd>{props.category}</dd>
                 <dd>{props.bookmark}</dd>
              <dd>{props.rating}</dd>  */}





            <div>
                <Card sx={{ maxWidth: 345 }}>

                    <img src={props.image} width={100} height={100} alt="book" />
                    <CardContent>
                        <Typography gutterBottom variant="h5" component="div">
                            {props.name}
                        </Typography>
                        <Typography variant="body2" >
                            {props.category}
                        </Typography>
                    </CardContent>
                    <CardActions>
                        <Button size="small">{props.rating}</Button>
                        {/* <Button button onClick={handleIconClick(101)}>
                            {clicked ? <TurnedInNotIcon /> : <BookmarkIcon />}
                        </Button> */}
                        <Button onClick={handleIconClick}>
                            {setClicked ? <BookmarkIcon /> : <TurnedInNotIcon />}
                        </Button>
                    </CardActions>
                </Card>


                {/* <div className="card">
                    <div className="top">
                        <h2 className="name">{props.name}</h2>
                        <img src={props.image} class="card-img-top" alt="..." />
                    </div>
                    <div className="bottom">
                        <p className="info">{props.category}</p>
                        <p className="info">{props.rating}</p>
                    </div>
                </div> */}

            </div>
        </div >
    );
}


export default Home;
